import React from "react";
import EventItem from "./EventItem";
import OrgSidebar from "./OrgSidebar";

function CreateEvents() {
  return (
    <>
      <OrgSidebar />
      <div
        style={{
          paddingTop: "100px",
          paddingLeft: "30%",
          height: "100%",
        }}
      >
        <Link to="/CreateEventForm">
        <div class="card border border-info pb-5" style={{ width: "200px", height: "200px", cursor:"pointer" }}>
          <div class="card-body">
            <h5 class="card-title text-center">Create Event</h5>
            <p
              class="text-center"
              style={{ justifyContent: "center", fontSize: "100px", color :"#19A7CE" }}
            >
              <i class="fa-solid fa-plus"></i>
            </p>
          </div>

        </div>
        <div style={{marginTop:"50px"}}>
        <h4>PreBuild Events</h4>
        <EventItem/>
        <EventItem/>
        <EventItem/>
        </div>
        </Link>
      </div>
    </>
  );
}

export default CreateEvents;
